<script lang="ts">
import {defineComponent, nextTick} from "vue"
import type {PropType} from "vue"
import type {IFPApiSectionPlan} from "@/froproApi/FPApi"

export default defineComponent({

  props: {
    FPApiSectionPlan: {
      required: true,
      type: Object as PropType<IFPApiSectionPlan>
    }
  },

  data() {
    return {
      top:    NaN,
      bottom: NaN,
      height: NaN,
      translateFrom_inPercent: -100,
      translateTo_inPercent: 0,
      arrayOfSectionOver: [] as {name: string, element: Element, color: string, id: string}[],
      activatedSection: null as {name: string, element: Element, color: string, id: string} | null,
    }
  },

  mounted() {
    nextTick(() => {

      if(! (this.$refs.svgContainer instanceof HTMLElement) ) return

      const svgSectionsElement = this.$refs.svgContainer.querySelectorAll('svg #Sections > *')

      svgSectionsElement.forEach((value, key) => {

        this.arrayOfSectionOver.push({
          name: this.getColorAndCleanedSectionName(value.id as string).cleanedSectionName,
          color: this.getColorAndCleanedSectionName(value.id as string).color,
          element: value,
          id: value.id
        })
      })

      console.log( this.arrayOfSectionOver )
    })
  },

  beforeMount() {
    window.addEventListener('scroll', this.setPlanPosition)
  },

  methods: {
    setPlanPosition() {
      if( !(this.$refs.planContainer instanceof HTMLElement) ) return
      this.top = this.$refs.planContainer.getBoundingClientRect().top
      this.bottom = this.$refs.planContainer.getBoundingClientRect().bottom
      this.height = this.$refs.planContainer.getBoundingClientRect().height
    },

    activeSection(section: {name: string, element: Element, color: string, id: string}) {
      if(! (event instanceof Event) ) return
      if(! (event.target instanceof HTMLElement) ) return

      this.activatedSection = section

      if(! (this.$refs.svgContainer instanceof HTMLElement) ) return

      const svgSectionsElement = this.$refs.svgContainer.querySelectorAll('svg #Sections > *')

      svgSectionsElement.forEach((value, key) => {
        if (! (value instanceof SVGElement) ) return

        value.style.display = value.id === section.id ? 'block' : 'none'
      })
    },

    getColorAndCleanedSectionName(sectionId: string): {color: string, cleanedSectionName: string} {

      return {
        cleanedSectionName: sectionId.replace(new RegExp('_', 'g'), ' ').replace(new RegExp('--.+', 'i'), ''),
        color: sectionId.match(new RegExp('--.*', 'ig'))?.[0].replace('--', '#') || 'black',
      }
    }
  },

  computed: {
    distance(): number { return this.height * 1.5},

    topFromBottomOfScreen(): number { return this.top - window.innerHeight},

    percentDistance(): number {
      const value = this.topFromBottomOfScreen * -100 / this.distance

      if( value < 0 ) return 0
      else if(value > 100) return 100

      return value
    },

    transitionStyleValue(): {
      transformValue: string
      opacityValue:   string
    } {
      const translateY = ((100 - this.percentDistance) * -1) / 2
      const scale = (value: number) => {
        const in_min  = 0
        const in_max  = 100
        const out_min = .85
        const out_max = 1

        return (value - in_min) * (out_max - out_min) / (in_max - in_min) + out_min
      }

      return {
        transformValue: `translate(0, ${translateY}%) scale(${scale(this.percentDistance)})`,
        opacityValue: `${this.percentDistance / 100}`,
      }
    },
  },

})</script>

